var UiObjectBase = require("./ui_object_base.js");
var UiObjectBaseTO = UiObjectBase.UiObjectBaseTO;
var UiObjectBaseDescription = UiObjectBase.UiObjectBaseDescription;

/**
 * The description of a UIAPro document test object.
 * @param {Object} [props] Initializes a UIAPro Document test object using the supplied property bag.
 * @returns {Document} the description object that was initialized.
 * @class Document
 * @extends UIAPro.UiObjectBaseDescription
 * @memberof UIAPro
 */
function Document(props) {
    var documentDesc = new UiObjectBaseDescription("Document");

    documentDesc._defineByPropertyBag(props);
    return documentDesc;
}

/**
 * A UIAPro document.
 * @constructor
 * @class DocumentTO
 * @extends UIAPro.UiObjectBaseTO
 * @memberof UIAPro
 */
function DocumentTO(session, description) {
    description = description || Document();
    var documentTO = new UiObjectBaseTO("UIAProDocument", session, description);
    
    return documentTO;
}

module.exports.DocumentTO = DocumentTO;
module.exports.Document = Document;